import React from 'react'
import '../App.css'
import { NavLink } from 'react-router-dom';
const Nav = () => (
  <nav>
        <ul>
          <li><NavLink to='/'>Book-A-Meal</NavLink></li>
          <li><NavLink to='/about'>Add a meal</NavLink></li>

        </ul>
      </nav>
    );

export default Nav
